    false,nt"url": null,nt"notes": "This narrative report for Sand Lake WMD
    outlines Refuge accomplishments from July to December of 1975. The report begins
    with an introduction to the Refuge and information about weather conditions and
    habitat conditions. Construction and maintenance are also described. Habitat management
    is covered; croplands, grasslands, wetlands, and forests are discussed. The wildlife
    section of the report discusses migratory birds, mammals, non-migratory birds, and
    fish. Interpretation and recreation activities are outlined; topics include recreation
    and law enforcement. Field investigations, cooperative programs, and safety information
    are attached.",nt"license_title": "License Not Specified",nt"extras":
